import NavScrollExample from './components/NavBar'
import Container from 'react-bootstrap/esm/Container'
import MoviesList from './components/MoviesList'
import axios from 'axios'

const App = () => {

  const getAllMovies = ()=>{
    axios.get('https://api.themoviedb.org/3/movie/popular?api_key=8a1f71f93bc3ebd2776eab1af18a30bd&language=en-US&page=1')
  }


  return (
    <div className='font color-bdy'>
      <NavScrollExample />
      <Container>
        <MoviesList />
      </Container>
    </div>
  )
}

export default App
